import React from 'react';

// third-party
import { FormattedMessage } from 'react-intl';

// assets
import { IconBrandChrome } from '@tabler/icons';

import menuData from './json/menu-items.json';

// constant
const icons = { IconBrandChrome };

// ===========================|| SAMPLE PAGE & DOCUMENTATION MENU ITEMS ||=========================== //

console.log(menuData)


const preparedMenuItems = [
    {
        id: 'sample-docs-roadmap',
        type: 'group',
        children: [
            {
                id: 'client-assessment',
                title: <FormattedMessage id="client-assessment" />,
                type: 'item',
                url: '/client-assessment',
                icon: icons.IconBrandChrome,
                breadcrumbs: true
            },
            {
                id: 'client-assessment',
                title: <FormattedMessage id="client-assessment" />,
                type: 'item',
                url: '/client-assessment',
                icon: icons.IconBrandChrome,
                breadcrumbs: false
            },
        ]
    },
    {
        id: 'sample-docs-roadmap',
        type: 'group',
        children: [
            {
                id: 'client-assessment',
                title: <FormattedMessage id="client-assessment1" />,
                type: 'item',
                url: '/client-assessment',
                icon: icons.IconBrandChrome,
                breadcrumbs: false
            }
        ]
    }
];

export default preparedMenuItems;
